import React from 'react'
import Link from 'next/link'
import {Article} from './articles_styled'

const Articles = ({ articles }) => (
	articles.map(({id, type, title}) => (
		<Link href={`/article/[id]`} as={`/article/${id}`} key={id}>
			<Article>
				{title}
				<p>
					{type}
				</p>
			</Article>
		</Link>
	)
))

export default Articles
